@Bojigirl There are actually conventions built into the English language that instruct us on how to pronounce things. For instance, the word 'fell' has a double L at the end, and all words with the suffix -ell are pronounced as rhymes with 'tell.' The word 'feel' has two E's next to each other, which in English is pronounced one way: like gee, tee, etc. So, yes, there are conventions and instructions built into every language.
Incidentally, I do pronounce her name correctly bc I know how it's pronounced. BUT, I would never fault someone for not knowing. 
Maybe her parents should have added an 'h' as in Kahmala.

@Kirsty Fairly until the court has officially determined guilt and innocence, it is not for us to make that decision. You say you have watch the court case closely, yet the court have sided with Amber in the liable caseIn the UK that's huge, because our court systems take liable accusations very seriously. 

The legal system is based on an innocent until proven guilty, and as none of us are unbiased in our views i think it's inappropriate and irresponsible to take sides.

